}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1432922472209424,\"y\":24.842363909013716,\"width\":49.156764803062195,\"height\":67.7471589369275,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Electricity is dangerous because:</p>\\n\\n<ul>\\n\\t<li>the human body conducts electric current.</li>\\n\\t<li>the voltage of the mains is 220 V. This value is capable of causing death.</li>\\n</ul>\\n\\n<p>A voltage of 25 V (in a damp place) or of 50 V (in a dry place) may send a current larger than 100 mA in the human body; if it lasts a few seconds, it would cause electrocution leading to death.</p>\\n\"},\"subContentId\":\"dca1c040-5ac2-48dd-ae84-822ea6afa1d7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":50.304858877721465,\"y\":24.842363909013716,\"width\":47.42044686720775,\"height\":54.19677862292003,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAxgAAAHLCAIAAADEKqmbAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAFSJSURBVHhe7d17rBVVnvf/4ve3CJhod+dphEGNT6LNRceeDkEutkYitEAc6R7EqAz2RfHpFnl+TZhRgs4QuhvUHo+2ozS2AZ1+UAMqGA3dzUViZqZHubQmj0H5gUwy05ooF//n9/nWd52169SuvU/tOmcfztnn/UqlWFW7dtXae1Pf+q6qVXVGnD2dAAAAoIL/J/wLAACAFpFIAQAAVEQiBQAAUBGJFAAAQEUkUgAAABWRSAEAAFREIgUAAFARiRQAAEBFJFIAAAAVkUgBAABURCIFAABQEYkUAABARSRSAAAAFZFIAQAAVEQiBQAAUBGJFAAAQEUjzp4Opd6NPBsKAAAAHezMiFDoTYuJVOn1AgAADEmtJDytJ1KclwIAAJ3KU532JlKl1w4A1cVmGzEHwMBoPdWhszkAAEBFJFIAAAAVkUgBAABURCIFAABQEYkUAABARSRSAAAAFZFIAQAAVEQiBQAAUBGJFAAAQEUkUgAAABWRSAEAAFREIgUAAFARiRQAAEBFJFIAAA rth). This connection allows the flow of any leakage of electric current towards the ground.</li>\\n\\t<li><strong>Differenital Circuit Breaker</strong>: If an accidental contact takes place between the live line and the body of the machine, there will be a leakage of current. A differential circuit breaker detects such leakages by detecting the difference of electric current between the live and the neutral terminals. As a result, the differential circuit breaker switches off which breaks the electric current in the circuit protecting individuals against electrocution.</li>\\n</ol>\\n\"},\"subContentId\":\"ca9c8bef-5513-4d69-91ff-6618fcb029d0\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":59.451196855489,\"y\":20.325570471011222,\"width\":38.22883451645026,\"height\":35.814332688937476,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAoMAAAExCAYAAAAHhKhtAAAABGdBTUEAALGPC/xhBQAAAAlwSFlzAAAOxAAADsQBlSsOGwAA/7JJREFUeF7snQegHUX1xr/bX00vpIfeIZTQO4pIU5oNRRRUUFFBARXFgihVRf+AioogCAgoTUCk9957CYH0Xl6/9X9+c98J6/O9kPASkzz3e5ns3t3Z2ZnZOWe+OdMSFYNivCe6ZhO/E4nEkmNXdHctRowYMWLEiBFjdUOy8xjjPeDEr1Qq/Rsx9OvRa+VyufMsRowYMWLEiBFj9UZsGVxGLG82xZbBGDFixIgRI8aagNgyuIxwMsjRHVZCvxa1BnLu/mPEiBEjRowYMVZnxGRwGYGlz7uE/VgsFgPx83uO6HmMGDFixIgRI8bqjLibeBmBFTCZTAai19zcrOeee06vvfaa1llnHQ0fPlw1NTXK5/Phfn19vdLpdHCpVCpc41mcXyPbPbwYMWLEiBEjRoxVhf9ZMtg12U7OOOKcpGH58+tTp07VI488ouuvv1433HCDWltbgx+QyWTUr1+/4B+LIefDhg0Lx1wuFwhiXV1duNa/f//gj3uNjY3h/uDBg5XNZkM4o0aN0ujRo8N1B/GJWiGjJNLjGz3iPN5R//zuCe4X+DFGjBgxYsSI0bfxP08GIVicY63jHIf1LpothUJBv/vd74J7/fXX1dHRsYR0cYTkQeJ8pjH3IYQeLnDLIo57gPf4+7Asco9ziOOQIUOC1XH8+PHaY489tP322wfyGLUqdgVhdXcdeDq573EH/PZ4E3Y0njFixIgRI0aMvo// :\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1432922472209424,\"y\":15.808050278583382,\"width\":72.02501066120021,\"height\":84.19573976042929,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>To ensure protection against electrocution and fire, it is advisable to provide the domestic circuits with breakers that would switch off the live line automatically in emergencies.<br />\\nWhat are these switching-off devices and how do they function?</p>\\n\\n<p><strong>1. The Fuse</strong></p>\\n\\n<p>A fuse is an electrical safety device that protects an electric circuit against overcurrent.It is made up of a metal strip that melts when the current flowing through it exceeds its rated current. As a result, the electric current stops flowing in the circuit.</p>\\n\\n<p><strong>2. The Circuit Breaker</strong></p>\\n\\n<p>A circuit breaker functions similar to a fuse.It is designed to protect an electric circuit from damage caused by overcurrent from an overload or short circuit. Its basic function is to break the current flow after a fault is detected. Unlike a fuse, which operates once and then must be replaced, a circuit breaker can be reset to resume function.</p>\\n\"},\"subContentId\":\"4f1c71c0-03c5-4359-9fc7-2a17ae285458\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":29.7255984277445,\"y\":2.258396719001247,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><strong>General Safety Measures</strong></h3>\\n\"},\"subContentId\":\"3ca33c10-f7c2-4330-bc52-ec73f6db6aca\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Tex
